import React from "react";
import Button from "../../../Button/index";
import {
  faBookmark,
  faTachometerAlt,
  faCog,
  faUsers,
  faTruckMoving,
  faMoneyBillAlt,
  faPrint,
} from "@fortawesome/free-solid-svg-icons";
import "./index.scss";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

import "./index.scss";

const SideDrawer = (props) => {
  return (
    <nav className={`side-drawer ${props.show && "open"}`}>
      <div className="side-drawer-header"></div>
      <ul>
      <a className="navbar-button text-center" href="/">
          <div className="text-center"><FontAwesomeIcon icon={faTachometerAlt} className="" /></div>
          Dashboard
        </a>
        <li>
        <Button
                                    name="Logout"
                                    havingIcon={false}
                                    buttonType="btn btn-light"
                                    isRoundButton={true}
                                />
        </li>
      </ul>
    </nav>
  );
};

export default SideDrawer;
